post_text:
As we near Thanksgiving, I just want to express my gratitude...
to students for making it worthwhile to go to work each day;
to parents for entrusting us with their students;
to teachers who do all they can daily to help students be ready for what is next in life;
to support staff and coaches who keep track of us, guide us to wins, feed us, help teach us, and drive us toward the future;
to the best administrative team anywhere for daily seeking the better in all we undertake;
and to my wife and kids who make my life and this world much better.
I’d be remiss if I didn’t thank all of you at this time for making my life much better than it might otherwise be and for the association we get to have as Rockwell Marshals.

